import React from "react";
import "./Banner.css";

function Banner() {
  return (
    <div className="banner">
          <div className="banner__info">
              <h1>Get out and stretch your imagination</h1>
              <h5>Plan a different kind of getway to uncover the hiden  </h5>
          </div>
    </div>
  );
}

export default Banner;
